// I create markers for all univerities
var mymarkers=[];
for (var i = 0; i < myUni.length; i++) {
	//I create temporary marker
	var marker=  L.marker([myUni[i].lat, myUni[i].lng], title=myUni[i].uid);
	// I create HTML for marker popup
	var myPopupText = '<b><u>' + myUni[i].university + '</u></b></br><a href=' + myUni[i].url + ' target=_blank>Visit website</a></br>Rank: ' + myUni[i].rank + '</br><button class=trigger>Show courses</button>';
	// link popup text to marker
	marker.bindPopup(myPopupText).openPopup();
	// I add merker to map
	marker.addTo(mymap);
	//I add marker to array
	mymarkers.push(marker);
};

// code for when 'Show courses' is clicked in the marker popup
$('#map').on('click', '.trigger', function() {
	var myText = "";
	// Find open marker popup => identify university; i = uid
	for (var i = 0; i < myUni.length; i++) {
	  	if (mymarkers[i].getPopup()._isOpen) {
		//Find master degrees for that university
			//start of HTML for popup window
			myText = "<b><u><font size=5>" + myUni[i].university + "</font></u></b>&nbsp;&nbsp;&nbsp;<a href=" + myUni[i].url + " target=_blank>Visit website</a></br></br><table border=1 style=width:100%><tr><th>Master Degrees</th><th>Cost</th><th>Duration</th></tr>";
		    // read inputs from web page
		    var r1 = document.getElementById("rank01").checked;
		    var r2 = document.getElementById("rank02").checked;
		    var r3 = document.getElementById("rank03").checked;
		    var r4 = document.getElementById("rank04").checked;
		    var r5 = document.getElementById("rank05").checked;
		    var range_to = +document.getElementById("amount-to").value;
		    var range_from = +document.getElementById("amount-from").value;
		    var clickboxnull = document.getElementById("clickboxnull").checked;
		    var disc = document.getElementById("Discipline").value;
			var MyRankCheck = false;
		    // check rank     
		    var MyRank = myUni[i].rank;
		    if ( r1 && MyRank < 11 ) MyRankCheck = true; 
		    if ( r2 && MyRank > 10 && MyRank < 31 ) MyRankCheck = true;
		    if ( r3 && MyRank > 30 && MyRank < 51 ) MyRankCheck = true;
		    if ( r4 && MyRank > 50 && MyRank < 101 ) MyRankCheck = true;
		    if ( r5 && MyRank > 100 ) MyRankCheck = true;
		    if ( MyRankCheck ) { // rank is within range
		    	// loop through all masters
		    	for ( var j = 0; j < myMasters.length; j++){
			    var MyAmountCheck = false;
			    var MyDisciplineCheck = false; 
		        	if ( myMasters[j].uid == myUni[i].uid ) { //check if masters is from the correct university
		            // check discipline
		            	if ( disc == "Any" ) {
		              		MyDisciplineCheck = true;
		            	} else {
		              		var MyDiscipline = myMasters[j].id_area;
		              		if (MyDiscipline == 1 && disc == "Agriculture and Forestry") { MyDisciplineCheck = true;
		              		} else if (MyDiscipline == 2 && disc == "Applied Sciences and Professions") { MyDisciplineCheck = true;
		              		} else if (MyDiscipline == 3 && disc == "Arts, Design and Architecture") { MyDisciplineCheck = true;        
		              		} else if (MyDiscipline == 4 && disc == "Business and Management") { MyDisciplineCheck = true;        
		              		} else if (MyDiscipline == 5 && disc == "Computer Science and IT") { MyDisciplineCheck = true;        
		              		} else if (MyDiscipline == 6 && disc == "Education and Training") { MyDisciplineCheck = true;        
		              		} else if (MyDiscipline == 7 && disc == "Engineering and Technology") { MyDisciplineCheck = true;        
		              		} else if (MyDiscipline == 8 && disc == "Environmental Studies and Earth Sciences") { MyDisciplineCheck = true;        
		              		} else if (MyDiscipline == 9 && disc == "Hospitality, Leisure and Sports") { MyDisciplineCheck = true;        
		              		} else if (MyDiscipline == 10 && disc == "Humanities") { MyDisciplineCheck = true;        
		              		} else if (MyDiscipline == 11 && disc == "Journalism and Media") { MyDisciplineCheck = true;        
		              		} else if (MyDiscipline == 12 && disc == "Law") { MyDisciplineCheck = true;        
		              		} else if (MyDiscipline == 13 && disc == "Medicine and health") { MyDisciplineCheck = true;        
		              		} else if (MyDiscipline == 14 && disc == "Natural science") { MyDisciplineCheck = true;        
		              		} else if (MyDiscipline == 15 && disc == "Social science") { MyDisciplineCheck = true;
		              		}
		            	};
		            	// check amount
		            	if (MyDisciplineCheck) {
			            	var MyCost = myMasters[j].cost;
			            	if ( MyCost <= range_to  &&  MyCost >= range_from ) MyAmountCheck = true; // within range
			            	if ( MyCost == -1 && clickboxnull ) MyAmountCheck = true; // no value (-1) and checkbox is on
			            }
		        	};
			  		if (MyRankCheck && MyAmountCheck && MyDisciplineCheck) { // if in rank ranges,  costs and discipline
			  			//add HTML code for current degree. Add N/A if cost is -1 
			  			if ( MyCost == -1 ) {
			  				myText = myText + "<tr><td>" + myMasters[j].master + "</td><td>N/A</td><td>" + myMasters[j].duration + "</td></tr>";
			  			} else {
			  				myText = myText + "<tr><td>" + myMasters[j].master + "</td><td>" + myMasters[j].cost + "</td><td>" + myMasters[j].duration + "</td></tr>";
			  			}
			  		}
		        }
	  		}
	  	}
	}
	// closing HTML for popup wndow
    myText = myText + "</table></br></br>"
    //open popup window
    var myWindow = window.open("", "MsgWindow", "titlebar=0,width=800,height=500");
	myWindow.document.write(myText);
});

// UPDATE MARKERS
function mySearch(){ 
  	// read values from web page
    var r1 = document.getElementById("rank01").checked;
    var r2 = document.getElementById("rank02").checked;
    var r3 = document.getElementById("rank03").checked;
    var r4 = document.getElementById("rank04").checked;
    var r5 = document.getElementById("rank05").checked;
    var range_to = +document.getElementById("amount-to").value;
    var range_from = +document.getElementById("amount-from").value;
    var clickboxnull = document.getElementById("clickboxnull").checked;
    var disc = document.getElementById("Discipline").value;
    var myCounter = 0;
    // loop through all universities
    for (var i = 0; i <myUni.length; i++) { 
      	var MyRankCheck = false;
		var MyAmountCheck = false;
      // check rank     
		var MyRank = myUni[i].rank;
		if ( r1 && MyRank < 11 ) MyRankCheck = true; 
		if ( r2 && MyRank > 10 && MyRank < 31 ) MyRankCheck = true;
		if ( r3 && MyRank > 30 && MyRank < 51 ) MyRankCheck = true;
		if ( r4 && MyRank > 50 && MyRank < 101 ) MyRankCheck = true;
		if ( r5 && MyRank > 100 ) MyRankCheck = true;
		if ( MyRankCheck ) {
			//Loop through degrees in current univerity
			for ( var j = 0; j < myMasters.length; j++){
				var MyDisciplineCheck = false; 
          		if ( myMasters[j].uid == myUni[i].uid ) {
            	// check discipline
            		if ( disc == "Any" ) {
              			MyDisciplineCheck = true;
            		} else {
              			var MyDiscipline = myMasters[j].id_area;
              			if (MyDiscipline == 1 && disc == "Agriculture and Forestry") { MyDisciplineCheck = true;
              			} else if (MyDiscipline == 2 && disc == "Applied Sciences and Professions") { MyDisciplineCheck = true;
						} else if (MyDiscipline == 3 && disc == "Arts, Design and Architecture") { MyDisciplineCheck = true;        
						} else if (MyDiscipline == 4 && disc == "Business and Management") { MyDisciplineCheck = true;        
						} else if (MyDiscipline == 5 && disc == "Computer Science and IT") { MyDisciplineCheck = true;        
						} else if (MyDiscipline == 6 && disc == "Education and Training") { MyDisciplineCheck = true;        
						} else if (MyDiscipline == 7 && disc == "Engineering and Technology") { MyDisciplineCheck = true;        
						} else if (MyDiscipline == 8 && disc == "Environmental Studies and Earth Sciences") { MyDisciplineCheck = true;        
						} else if (MyDiscipline == 9 && disc == "Hospitality, Leisure and Sports") { MyDisciplineCheck = true;        
						} else if (MyDiscipline == 10 && disc == "Humanities") { MyDisciplineCheck = true;        
						} else if (MyDiscipline == 11 && disc == "Journalism and Media") { MyDisciplineCheck = true;        
						} else if (MyDiscipline == 12 && disc == "Law") { MyDisciplineCheck = true;        
						} else if (MyDiscipline == 13 && disc == "Medicine and health") { MyDisciplineCheck = true;        
						} else if (MyDiscipline == 14 && disc == "Natural science") { MyDisciplineCheck = true;        
						} else if (MyDiscipline == 15 && disc == "Social science") { MyDisciplineCheck = true;
						}
		            };
        		    // check amount
        		    if (MyDisciplineCheck) {
	            		var MyCost = myMasters[j].cost;
	            		if ( MyCost <= range_to  &&  MyCost >= range_from ) MyAmountCheck = true;
	            		if ( MyCost == -1 && clickboxnull ) MyAmountCheck = true;
					}            		
          		}
        	}
		};
		// remove marker for current univeristy
		mymap.removeLayer(mymarkers[i]);
		if (MyRankCheck && MyAmountCheck) { 
			// add marker for current university
			mymarkers[i].addTo(mymap);
			// count visible markers
			myCounter = myCounter + 1;
			// update university count on web page
			if (myCounter == 1) { $('#mytext').val(myCounter + " university found");
			} else { $('#mytext').val(myCounter + " universities found");
			}
		}
		if (myCounter == 0)  $('#mytext').val("No university found");
	}
};


