$(function() {
  	//Change slider setting
    var range_from = 0;
    var range_to = 70000;
    $( "#slider-range" ).slider({
		range: true,
		min: 0,
		max: 70000,
		values: [ 0, 70000 ],
		slide: function( event, ui ) {
	        var range_from = ui.values[0];
	        var range_to = ui.values[1];
	        $( "#amount-from" ).val( range_from );
	        $( "#amount-to" ).val( range_to );
	        mySearch(); // update markers
    	}
    });
    $( "#amount" ).val( $( "#slider-range" ).slider( "values", 0 ) +
       + $( "#slider-range" ).slider( "values", 1 ) );
  	}	
);
